import React, { Component } from 'react';
import {BrowserRouter, Route, Switch} from 'react-router-dom';
import NavBar from './Components/navbar';
class App extends Component{
    render(){
        return(
            <BrowserRouter>
                <div className="app">
                    <NavBar />
                </div>
            </BrowserRouter>
        );
    }
}

export default App;
